# set a new precision
getcontext().prec = 6

def write_to_file(doc, name="data.xml"):
    file_object = open(name, "w")
    file_object.write( doc.toprettyxml() )
    file_object.close()

def GetInNewUnit(data, ratio):
    resStr = ''
    for eachVal in data:
        valInMeter = eachVal * ratio
        
        if abs(valInMeter) < 1E-6:
            valDe = Decimal( '0.0' )
        else:
            valDe = Decimal( str(valInMeter) ) + Decimal( '0.0' )
        resStr = resStr +  str(valDe) + ' '
    return resStr

def ConvertInchesToMeter(valueInInchLst):
    return GetInNewUnit(valueInInchLst, 0.0254)

def ConvertMetersToInch(valueInMeterLst):
    return GetInNewUnit(valueInMeterLst, 1.0/0.0254)

def GetInZUp(normalYUp):
    resInZUprStr = ''
    for i in range( len(normalYUp)/3 ):
        # swtich second and third
        resNX = normalYUp[i * 3 + 0]
        resNY = -normalYUp[i * 3 + 2]
        resNZ = normalYUp[i * 3 + 1]
        
        # convert them to demal
        if abs(resNX) < 1E-6:
            valDeX = Decimal( '0.0' )
        else:
            valDeX = Decimal( str(resNX) ) + Decimal('0.0')
        
        if abs(resNY) < 1E-6:
            valDeY = Decimal( '0.0' )
        else:
            valDeY = Decimal( str(resNY) ) + Decimal('0.0')
            
        if abs(resNZ) < 1E-6:
            valDeZ = Decimal( '0.0' )
        else:
            valDeZ = Decimal( str(resNZ) ) + Decimal('0.0')
        
        resInZUprStr = resInZUprStr +  str(valDeX) + ' ' + str(valDeY) + ' ' + str(valDeZ) + ' '
        
    return resInZUprStr

def Convert3d24d(vertexLst, wLst):
    
    res4dStr = ''
    
    if len( vertexLst ) % 3 == 0 and len( vertexLst ) / 3 == len( wLst ):
        # scan the list
        for i in range( len( vertexLst ) / 3):
            vertex4d = [Decimal( '0.0' ), Decimal( '0.0' ), Decimal( '0.0' ), Decimal( '1.0' )]
            
            for j in range(3):
                if abs(vertexLst[i * 3 + j])  > 1E-6:
                    # if w is not equal to 1.0, then multiply it by w
                    if abs(wLst[i] - 1.0)  > 1E-6:
                        # multiply by w
                        vertex4d[j] = Decimal( vertexLst[i * 3 + j] ) * Decimal( str(wLst[i]) )
                    else:
                        # do not change the value 
                        vertex4d[j] = Decimal( vertexLst[i * 3 + j] ) + Decimal( '0.0' )
                res4dStr = res4dStr + str( vertex4d[j] ) + ' '
            
            # if w is not equal to 1.0, then need to record it
            if abs(wLst[i] - 1.0)  > 1E-6:
                vertex4d[3] = Decimal( str(wLst[i]) )
            
            res4dStr = res4dStr + str( vertex4d[3] ) + ' '
        
    return res4dStr

